import React, {Component} from 'react'
import './Header.css'

class Header extends Component {
    render() {
        return (
            <div className="container">
                <div className="headerKu">
                    <div> <input placeholder="search" type="text"/> </div>

                    <div className="mx-3"> <a href="/login">Login</a> </div>

                    <div style={{
                        borderRightStyle: "solid",
                        borderWidth: "1px",
                        height: "16px",
                        borderColor: "#ebebeb"
                    }}></div>

                    <div className=""> <a href="/register">Register</a> </div>
                </div>
            </div>
        )
    }
}

export default Header
